                    <NavLink href="#"> OUR SERVICE PARTNER</NavLink>
                </NavItem>
                <NavItem>
                    <NavLink className="nav-link border-0 pr-0" href="#">CONTACT</NavLink>
                </NavItem>
            </Nav>
        </div>
    );

}
export default  NavMenu;
